import React,{useState} from 'react';


const Reactf =() =>{

    const [name,setName] =useState("");

    const inputEvent=(event)=>
    {
        setName(event.targt.value);

    };
    return(

        <>
        <div>
            <h1>Hello{name}</h1>
            <input type="text" placeholder="Enter Your Name"
            onChange={inputEvent}
            />
            
            <button>Click Me</button>
        </div>
        </>
    );
};
export default Reactf;
